import React from 'react';
import '../assets/css/style.css';

function Packages() {
  return (
    <section className="packages">
      <h1>Our Packages</h1>
      <div className="package-content">
        <div className="box">
          <h3>Bronze</h3>
          <ul>
            <li>2 Star Hotel</li>
            <li>5 Nights</li>
            <li>Free Photoshoot</li>
          </ul>
        </div>
        {/* Add more packages similarly */}
      </div>
    </section>
  );
}

export default Packages;
